];    function buildrestObject(object){
        var ul=$("<ul/>");
        if(Array.isArray(object)){
            var i;
            for(i=0;i<object.length;i++){
                var item=$("<li/>");
                ul.append(item)
                var sp=$("<span/>")
                sp.addClass("caret");
                sp.text(i);
                item.append(sp);
                item.append(buildrestObject(object[i]).addClass('nested'));
            }
        } else if(object instanceof Object) {
            for(var key in object){
                var li=$("<li/>");
                var span=$("<span><b>"+key+"</b>:&nbsp</span>");
                li.append(span);
                if(object[key] instanceof Object){
                    li.append(buildrestObject(object[key]));
                } else {
                    span.append(object[key]);
                }
                ul.append(li);
            }
        } else {
            return $("<span>"+object+"</span>");
        }
        return ul;
    }
    function buildLI(object) {
        var item=$("<li/>");
        if (!(object.type == 'get' || object.type == 'post' || object.type == 'patch' || object.type == 'put' || object.type == 'delete')){
            var sp=$("<span/>")
            sp.addClass("caret");
            sp.append("<b>"+object.name + "(" + object.type + ")</b>");
            item.append(sp);
            if(object.type=='command'){
                item.append(buildTree(object.steps).addClass('nested'));
            } else if(object.type=='block'){
                item.append(buildArray(object.iterations).addClass('nested'));
            }else if(object.type=='loop'){
                item.append(buildArray(object.iterations).addClass('nested'));
            }else if(object.type=='poll'){
                item.append(buildTree(object.iterations).addClass('nested'));
            }
        }
        else {
            item.append("<span class='caret'><b>"+object.name+"("+object.type+")"+"</b></span>");
            item.append(buildrestObject(object).addClass('nested'));
        }
        return item;
    }
    function buildArray(json){
        var tree=$("<ul/>");
        var i;
        for(i=0;i<json.length;i++){
            var item=$("<li/>");
            tree.append(item)
            var sp=$("<span/>")
            sp.addClass("caret");
            sp.text("Iteration "+i);
            item.append(sp);
            item.append(buildTree(json[i]).addClass('nested'));
        }
        return tree;
    }
    function buildTree(json){
        var tree=$("<ul/>");
        var i;
        for(i=0;i<json.length;i++){
            tree.append(buildLI(json[i]));
        }
        return tree;
    }
        $("#view").append(buildTree(json))
        console.log(json); // this will show the info it in firebug console
        var toggler = document.getElementsByClassName("caret");
        var i;

        for (i = 0; i < toggler.length; i++) {
            toggler[i].addEventListener("click", function() {
                this.parentElement.querySelector(".nested").classList.toggle("active");
                this.classList.toggle("caret-down");
            });
        }
